sap.ui.define([
	"ZMedical_App/ZMedical_App/controller/BaseController", 
	"sap/m/MessageBox",
	"sap/ui/core/HTML"
], function (Controller,MessageBox) {
	"use strict";

	return Controller.extend("ZMedical_App.ZMedical_App.controller.dashboard", {
		onInit: function () {
			var oRouter = new sap.ui.core.UIComponent.getRouterFor(this);
			oRouter.getRoute("dashboard").attachPatternMatched(this.onObjectMatched, this);
			var oModel = new sap.ui.model.json.JSONModel();
			oModel.setSizeLimit(99999)
			var propData = {
				UploadedAttachment:[],
				Single_Record:{},
			};
			oModel.setProperty("/",propData);
			sap.ui.getCore().setModel(oModel,"AttachModel")
			this.getBackenddata();
		},
		onObjectMatched: function (evt) {
			this.getBackenddata();

		},
		getBackenddata: function () {
		sap.ui.core.BusyIndicator.show();
			var gpfservice = new sap.ui.model.odata.ODataModel("/sap/opu/odata/sap/ZHCM_MEDICAL_SRV/");
			var t = this;
			gpfservice.read("/medicalSet", {
				success: function (odata) {
					for (var i = 0; i < odata.results.length; i++) {
							delete odata.results[i].__metadata;
						var frmt = sap.ui.core.format.DateFormat.getDateInstance({pattern: "dd-MM-yyyy"});
						var d = frmt.format(new Date(odata.results[i].Cdate));
						odata.results[i].Cdate =d;
					}
					var dashboard = new sap.ui.model.json.JSONModel();
					dashboard.setData(odata.results);
					t.getView().setModel(dashboard, "dashboard");
					sap.ui.core.BusyIndicator.hide();
				},
				error: function (error) {
				sap.ui.core.BusyIndicator.hide();
					var message = error;
					var msg = $(error.response.body).find('message').first().text();
					var action = "OK";
					new sap.m.MessageBox.error(msg, {

						onClose: function () {
							if (action === "OK") {

							}
						}
					});
				}
			});

		},
		onSearch:function(oEvent){
			var sQuery = oEvent.mParameters.newValue;
			if(oEvent.getId() == "liveChange"){
				sQuery = oEvent.getParameter("newValue");
			}
			var oFilter1=new sap.ui.model.Filter("Zreqno","Contains",sQuery);
			var oFilter2=new sap.ui.model.Filter("Cdate","Contains",sQuery);
			var oFilter3=new sap.ui.model.Filter("Zreqty","Contains",sQuery);
			
			var oFilter5=new sap.ui.model.Filter("Status","Contains",sQuery);
			
			var aFilters=new sap.ui.model.Filter([oFilter1,oFilter2,oFilter3,oFilter5]);
			var oTable=this.getView().byId("dashboard");
			var oBinding=oTable.getBinding();
			if(oBinding){
				oBinding.filter([aFilters]);
			}
		},
		
		
		cancel_req:function(){
		
	
		
		 
		new sap.m.MessageBox.confirm(
			"Do You Want To Cancel The Request", {
				
				title: "Cancel Request",
				actions: [ sap.m.MessageBox.Action.YES,  sap.m.MessageBox.Action.NO],
				emphasizedAction:  sap.m.MessageBox.Action.YES,
				onClose: function (oAction) { 
				
				if(oAction==="YES"){
				
				}
				}
			}
		);
		},
		
		basePerforma:function(){
			return  "data:application/pdf;base64,";
		},
		baseDepndCert:function(){
			return "data:application/pdf;base64,";
		},
		baseOPD:function(){
			return "data:application/pdf;base64,";
		},
		baseAdmitted:function(){
			return "data:application/pdf;base64,";
			
		},
		downloadPerforma:function(){
			var base64Val =this.basePerforma();
			this.download("Check List Perfoma", base64Val);
		},
		downloadDepndCert:function(){
			var base64Val =this.baseDepndCert();
			this.download("Dependent Certificate", base64Val);
		},
		downloadOPD:function(){
			var base64Val =this.baseOPD();
			this.download("Essentiality Certificate(O.P.D.)", base64Val);
		},
		downloadAdmitted:function(){
			var base64Val =this.baseAdmitted();
			this.download("Essentiality Certificate(Admitted)", base64Val);
		},
		download:function(title,value){
//		     var key=evt.mParameters.id.slice(12);
//        var base64Val =this.medFormBase()
        var oDialog=new sap.m.Dialog({
								title:title,//"Medical Form",
								contentheight:"100%",
								contentWidth:"100%",
								content:[new sap.ui.core.HTML({
									content:"<iframe src='"+value+"' height='500px' width='1400px' frameborder='0'></iframe>"
								})],
								buttons:[new sap.m.Button({
									text:"Close",
									press:function(){oDialog.destroy();}
								})]
							}).addStyleClass("pdfDialog");
							oDialog.open()
		},
		claim_advance:function(evt){
		 var path=parseInt(evt.getSource().oPropagatedProperties.oBindingContexts.dashboard.sPath.slice(1));
       var reqno=this.getView().getModel("dashboard").getData()[path].Zreqno;
        
        var router = this.getOwnerComponent().getRouter();
			router.navTo("emp_medical_form", {obj:reqno,obj2:"F",obj3:"D"});
        
		},
		
		
		
		
		
		edit_req:function(evt){
			try{
				var currRecord = this.getView().getModel("dashboard").getProperty(evt.getSource().getBindingContext("dashboard").getPath())
				var propData = {
					UploadedAttachment:[],
					Single_Record:currRecord,
				};
				sap.ui.getCore().getModel("AttachModel").setProperty("/",propData)
				if(currRecord.Zreqno && currRecord.Zreqno.trim()){
					this.getAttachments("MDCL")
				}
			
			}catch(e){
				console.log(e)
			}
			 var path=parseInt(evt.getSource().oPropagatedProperties.oBindingContexts.dashboard.sPath.slice(1));
       var reqno=this.getView().getModel("dashboard").getData()[path].Zreqno;
        
        var router = this.getOwnerComponent().getRouter();
			router.navTo("emp_medical_form", {obj:reqno,
				obj3:"D",
			obj2:"D"});
		},
		
		
		reqnopress:function(evt){
			try{
				var currRecord = this.getView().getModel("dashboard").getProperty(evt.getSource().getBindingContext("dashboard").getPath())
				var propData = {
					UploadedAttachment:[],
					Single_Record:currRecord,
				};
				sap.ui.getCore().getModel("AttachModel").setProperty("/",propData)
				if(currRecord.Zreqno && currRecord.Zreqno.trim()){
					this.getAttachments("MDCL")
				}
			}catch(e){
				console.log(e)
			}
			var reqno=evt.oSource.mProperties.text;
			var router = this.getOwnerComponent().getRouter();
			router.navTo("emp_medical_form", {obj:reqno,
				obj3:"D",
			obj2:"D"});
		},
		
		MedicalAdvance: function (evt) {
			var router = this.getOwnerComponent().getRouter();
			router.navTo("emp_medical_form", {obj: "1",obj2:"C",obj3:"M"});
		},
		
		MedicalReibusementwithAdvance: function (evt) {
				var router = this.getOwnerComponent().getRouter();
				router.navTo("emp_medical_form", {obj: "2",obj2:"C",obj3:"M"});
			},
		MedicalReibusementWithOutAdvance:function(evt){
			
			var router = this.getOwnerComponent().getRouter();
			router.navTo("emp_medical_form", {obj: "3",obj2:"C",obj3:"M"});
			
		},
			
			MedicalPermmission:function(evt){
				var propData = {
						UploadedAttachment:[],
						Single_Record:{},
					};
				sap.ui.getCore().getModel("AttachModel").setProperty("/",propData)
				var router = this.getOwnerComponent().getRouter();
				router.navTo("emp_medical_form", {obj: "4",obj2:"C",obj3:"M"});
			},
			MedicalClaim:function(evt){
				var propData = {
						UploadedAttachment:[],
						Single_Record:{},
					};
				sap.ui.getCore().getModel("AttachModel").setProperty("/",propData)
				var router = this.getOwnerComponent().getRouter();
				router.navTo("emp_medical_form", {obj: "6",obj2:"C",obj3:"M"});
			}
	});
});